import React from "react";

import Button from "@material-ui/core/Button";

export default class ButtonAdd extends React.Component {
  handleClick = () => {
    console.log("test");
  };
  render() {
    return (
      <div>
        <Button variant="contained" color="primary" onClick={this.handleClic}>
          Hello World
        </Button>
      </div>
    );
  }
}
